import 'bootstrap/dist/css/bootstrap.min.css';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Card from 'react-bootstrap/Card';

function MyNav() {
    return (
      <Navbar expand="lg" className="bg-body-tertiary MyNavbar fixed-top">
         <Navbar.Brand href="#home" className='ps-4'>BookStore</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link href="#">Home</Nav.Link>
              <Nav.Link href="#">About</Nav.Link>
              <Nav.Link href="#">Browse</Nav.Link>
            </Nav>
          </Navbar.Collapse>
         </Navbar>
    );
  }

function MyFooter(){
return(
<Card>
      <Card.Header>BookStore</Card.Header>
      <Card.Body>
        <blockquote className="blockquote mb-0">
          <p>
          Per sognare non bisogna chiudere gli occhi, bisogna leggere
          </p>
          <footer className="blockquote-footer">
            cit <cite title="Source Title">Michel Foucault</cite>
          </footer>
        </blockquote>
      </Card.Body>
    </Card>

);

}

  export {MyNav, MyFooter}
